Getting to the Bahamas with 12 duffle bags full of disaster relief supplies would have never been possible without our partnership with Airlink!!They got us to the Bahamas by way of Jetblue, and the attendants were not only so helpful, but Deaf-Friendly! We even met an attendant who is Hard-of-Hearing! Airports were destroyed within the islands so Airlink was able to then put us on smaller airlines and airplanes alongside other NGOs.  Traveling is stressful as is, then when carrying equipment and heading to regions where systems are down... navigating in the dark, redirected airstrips, processing baggage in tents without losing any... it is really an understatement how appreciative we are for everyone‚Äôs support! Thank you @airlinkflight and @jetblue for assisting us in bringing disaster relief to Deaf people üëâü§ü#offthegridBAHAMAS #otgmissions #otgfrontlines #airlink #jetblue
